import React from "react";

function Intro() {
    return (
        <div className="intro">
            <div className="intro-container">
                <div className="sub-head">About</div>
                <p>The New York Botanical Garden is an advocate for the plant world. 
                    The Garden pursues its mission through its role as a museum of living plant collections arranged in gardens and landscapes across its National Historic Landmark site; through its comprehensive education programs in horticulture and plant science; and through the wide-ranging research programs of the International Plant Science Center.</p>
                <img src="https://i.postimg.cc/C16pBTGV/1.png" alt="image" />
            </div>       
        </div>
    )
}

export default Intro;
